import React, { Component } from 'react';
import "../pages/projects/project.scss";
export default class ProjectCard extends Component{

  constructor(props){
    super(props)
  }
render(){
    return(
        <div class="container">
          <div class="card">
            <img src="//unsplash.it/399/400" alt="" class="card-img"></img>
            <div class="card-text">
              <h3 class="card-title">{this.props.batata.title}</h3>
              <p class=" card-body">{this.props.batata.title}</p>
            </div>
          </div>
          </div>

    )}
}
